sys_variable_value.value:
(function execute(inputs, outputs) {
  	var attachment = new GlideSysAttachment();
	outputs.attachmentcontent = attachment.getContentBase64(inputs.attachment);
  	var name = inputs.attachment_name.trim();
	if(name !=null)
    	outputs.attachment_name = name;
  	else
      throw new Error("Invalid input Name");
})(inputs, outputs);

