sys_variable_value.value:
(function execute(inputs, outputs) {
  try{
    if (inputs.status_code == '200' && inputs.response) {
        var xmlDoc = new XMLDocument2();
        xmlDoc.parseXML(inputs.response);
        var responseStatus = xmlDoc.getNode(
            "/s:Envelope/s:Body/m:CreateAttachmentResponse/m:ResponseMessages/m:CreateAttachmentResponseMessage"
        ).getAttribute('ResponseClass');
        if (responseStatus === 'Success') {
            outputs.status = 'Success';
            outputs.attachment_id = xmlDoc.getNode(            "/s:Envelope/s:Body/m:CreateAttachmentResponse/m:ResponseMessages/m:CreateAttachmentResponseMessage/m:Attachments/t:FileAttachment/t:AttachmentId").getAttribute('Id');
        } else
            outputs = new ExchangeErrorHandler().createAttachment(
                inputs, outputs);
    } else
        outputs = new ExchangeErrorHandler().createAttachment(
            inputs, outputs);
  }catch(Exception e){
    throw new Error(e);
  }
})(inputs, outputs);

